import React from 'react';
import RatingSelector from './RatingSelector';

export default function Movie(props) {
    return (
        <li className="movie-group-item">
            {props.item.title}
            <RatingSelector
                rating={props.item.rating}
                onChange={(newRating) => props.updateRating(props.item.id, newRating)}
            />
            <button className="btn btn-sm btn-danger float-end" onClick={() => props.deleteMovie(props.item.id)}>Delete</button>
        </li>
    );
}
